import React, { Component } from 'react'
import axios from 'axios'

export default class holiday extends Component {
    state ={
        holidays: [],
    }
    componentDidMount(){
        axios.get('https://sholiday.faboul.se/dagar/v2.1/2015')
        .then(res=>{
            this.setState({holidays:res.data});
            console.log(res);
        })
    }
    render() {
        return (
            <ul>
              {this.state.holidays.map(holiday=><li>{holiday.namsdag}</li>) } 
            </ul>
        )
    }
}
